import {useState} from "react";

export default function Navbar() {
    const [user, setUser] = useState(null);

    return (
        <div>
            <div className="bg-slate-800 flex items-center text-white h-16">
                <Link to={'/'} className="text-2xl font-bold px-4">Belbay</Link>
                {user && (
                    <div>

                    </div>
                )}
                {!user && (
                    <div className="ml-auto grid grid-cols-2">
                        <Link to={'/login'}>
                            <button className="border hover:bg-gray-700 rounded-lg py-2 px-2">Логин</button>
                        </Link>
                        <Link to={'/register'}>
                            <button className="border hover:bg-gray-700 rounded-lg py-2 px-2 -ml-4">Регистрация</button>
                        </Link>
                    </div>
                )}
            </div>
        </div>
    );
}
